import React, {
    useState,
    useEffect
} from "react"

const PopUp1 = (props) =>{
    return(
        <div className="pop-up" style={props.popUpStyle}>
            <div className="pop-up-logout">
                <h4>Are you sure?</h4>
                <div className="pop-up-logout-choice">
                    <button className="btn btn-danger" onClick={props.yes}>Yes</button>
                    <button className="btn btn-primary" onClick={props.closePopUp}>No</button>
                </div>
            </div>
        </div>
    )
}

export default PopUp1;
